import React from "react";

const ItemLoader = () => {
  return (
    <div className="item">
      <div className="play-icon play-icon-plh"></div>
      <section className="item-info">
        <div className="profile-ld"></div>
        <div className="price-ld"></div>
      </section>
    </div>
  );
};

export default ItemLoader;
